import React, { Fragment, useEffect, useState } from "react";
import Button from '@mui/material/Button';
import { fetchHome } from "../apis/home";
//ダイアログ
import { SignUpDialog } from "../components/SignUpDialog"
import { LogInDialog } from "../components/LogInDialog"

export const Home = (props) => {


  //Home画面の更新
  useEffect(() => {
    fetchHome()
  }, [])

  return (
    <Fragment>
      <h1>HOME画面</h1>

      <Button variant="outlined" onClick={props.handleClickOpenSignUp}>
        新規登録
        <SignUpDialog open={props.open.signUpDialog} handleClose={props.handleCloseSignUp} handleLogin={props.handleLogin} />
      </Button>

      <Button variant="outlined" onClick={props.handleClickOpenLogIn}>
        ログイン
        <LogInDialog open={props.open.logInDialog} handleClose={props.andleCloseLogIn} handleLogin={props.handleLogin} />
      </Button>

    </Fragment>
  )
}
